/* element onscreen detect
 =============================================================================================================== */
$.fn.isOnScreen = function () {
    if (this.length) {
        var viewport = {};
        viewport.top = $(window).scrollTop();
        viewport.bottom = viewport.top + $(window).height();
        var bounds = {};
        bounds.top = this.offset().top;
        bounds.bottom = bounds.top + this.outerHeight();
        return ((bounds.top <= viewport.bottom) && (bounds.bottom >= viewport.top));
    } else
        return false;
};

$.fn.loadAnim = function () {
    var actAnimfunction = function (elem, elem_position, delay) {
        if (elem_position === "top-load") {
            TweenLite.to(elem, 1, {
                css: {
                    'opacity': '1',
                    'top': '0px'
                },
                delay: delay,
                ease: Quart.easeOut
            });
        } 
    };
    var elem = this;
    $(window).load(function () {
        elem.each(function () {
            var elem_ = $(this);
            if (elem_.isOnScreen()) {
                var delay = parseFloat(elem_.attr('anim-delay'));
                //console.log(delay);
                actAnimfunction(elem_, elem_.attr('type-anim'), delay);
            }

        });
    });
};

 /* function for scroll content
 =============================================================================================================== */

$.fn.scrollAnim = function () {
    var actAnimfunction = function (elem, elem_position, delay) {
        if (elem_position === "top") {
            TweenLite.to(elem, 1, {
                css: {
                    'opacity': '1',
                    'top': '0px'
                },
                delay: delay,
                ease: Quart.easeOut
            });
        } else if (elem_position === "top-load") {
            TweenLite.to(elem, 1, {
                css: {
                    'opacity': '1',
                    'top': '0px'
                },
                delay: delay,
                ease: Quart.easeOut
            });
        } else if (elem_position === "bottom") {
            TweenLite.to(elem, 0.5, {
                css: {
                    'opacity': '1',
                    'margin-bottom': '0px'
                },
                delay: delay,
                ease: Quart.easeOut
            });
        } else if (elem_position === "left") {
            TweenLite.to(elem, 0.5, {
                css: {
                    'opacity': '1',
                    'margin-left': '0px'
                },
                delay: delay,
                ease: Quart.easeOut
            });
        } else if (elem_position === "right") {
            TweenLite.to(elem, 0.5, {
                css: {
                    'opacity': '1',
                    'margin-right': '0px'
                },
                delay: delay,
                ease: Quart.easeOut
            });
        } else if (elem_position === "absolute_bottom") {
            TweenLite.to(elem, 0.5, {
                css: {
                    'opacity': '1',
                    'bottom': '0px'
                },
                delay: delay,
                ease: Quart.easeOut
            });
        } else if (elem_position === "absolute_right") {
            TweenLite.to(elem, 0.5, {
                css: {
                    'opacity': '1',
                    'right': '0px'
                },
                delay: delay,
                ease: Quart.easeOut
            });
        } else if (elem_position === "absolute_left") {
            TweenLite.to(elem, 0.5, {
                css: {
                    'opacity': '1',
                    'left': '0px'
                },
                delay: delay,
                ease: Quart.easeOut
            });
        } else if (elem_position === "absolute_top") {
            TweenLite.to(elem, 0.5, {
                css: {
                    'opacity': '1',
                    'top': '0px'
                },
                delay: delay,
                ease: Quart.easeOut
            });
        } else if (elem_position === "fade") {
            TweenLite.to(elem, 0.5, {
                css: {
                    'opacity': '1',
                    'scale': '1'
                },
                delay: delay,
                ease: Quart.easeOut
            });
        } else {
            TweenLite.to(elem, 0.5, {
                css: {
                    'opacity': '1',
                    'scale': '1'
                },
                delay: delay,
                ease: Quart.easeOut
            });
        }
    };
    var elem = this;
    $(window).scroll(function () {
        elem.each(function () {
            var elem_ = $(this);
            if (elem_.isOnScreen()) {
                var delay = parseFloat(elem_.attr('anim-delay'));
                //console.log(delay);
                actAnimfunction(elem_, elem_.attr('type-anim'), delay);
            }

        });
    });
};

/* function for checkbox n radio
=============================================================================================================== */

$.fn.optCustom = function (q) {
    var
            elem = this,
            s = {
                className: 'checkbox_custom',
            };
    s = $.extend(s, q);
    elem.wrap("<div class='" + s.className + "' style='position:relative' ></div>");
    elem.css({
        position: 'absolute',
        top: 0,
        left: 0,
        opacity: 0,
        width: "100%",
        height: "100%"
    });
    elem.each(function () {
        if ($(this).is(":checked")) {
            $(this).parent().addClass('active');
        }
    });
    elem.on('change', function () {
        if ($(this).attr('type') === "checkbox")
            if (!$(this).is(":checked")) {
                $(this).parent().removeClass('active');
            } else {
                $(this).parent().addClass('active');
            }
        else
            $("input[type=radio][name=" + $(this).attr('name') + "]").each(function () {
                if ($(this).is(":checked")) {
                    $("input[type=radio][name=" + $(this).attr('name') + "]").parent().removeClass('active');
                    $(this).parent().addClass('active');
                    console.log('jada')
                }
            });
    });

    elem.parent().on('click', function () {
        if ($(this).attr('type') === "checkbox")
            if (!$(this).children('input').is(":checked")) {
                $(this).removeClass('active');
            } else {
                console.log('sa')
                $(this).addClass('active');
            }
        else
            $("input[type=radio][name=" + $(this).attr('name') + "]").each(function () {
                if ($(this).is(":checked")) {
                    $("input[type=radio][name=" + $(this).attr('name') + "]").parent().removeClass('active');
                    $(this).parent().addClass('active');
                    return false;
                }
            });
    });

};

